‚Å†
Your EPG will only be used if and when you become unable to communicate your wishes or make decisions for yourself.‚Å†
‚Å†
You should appoint someone you know and trust. For example, your spouse or partner, other relative or close friend.‚Å†
‚Å†
You should ensure your Enduring Guardian is aware of your personal beliefs and preferences about your lifestyle.‚Å†
‚Å†
You can choose the decisions your Enduring Guardian will be able to make, such as where you live and what treatment and services you receive.‚Å†
‚Å†
If you give your Enduring Guardian the power to make treatment decisions for you and you have also made an AHD, treatment decisions will be made in accordance with your AHD and not by your Enduring Guardian as far as the provisions of the documents overlap.‚Å†
‚Å†
